import axios from'axios'

export default function MocksTeste () {

    const [books, setBooks] = React.useState([])

    React.useEffect(() => {
        const getBooks = async () => {
            const response = await axios.get('http://localhost:3001/books')
            console.log(response)
        }

        getBooks()
    })
    return (
        <h1>Ola mundo</h1>
    )
}
